import React from 'react'
import './App.css'
import { Switch,Route } from 'react-router-dom';
import Homepage from './pages/Homepage';

const HatsPage=()=>{
  return(
    <div>
      <h1>Hats Page here</h1>
    </div>
  )
}


function App () {
  return(
    <div>
      <Switch>
        <Route exact path="/">
          <Homepage />
        </Route>

        <Route path="/hats">
          <HatsPage />
        </Route>

    </Switch>
    </div>
  )
}


export default App;
